def wordPattern(pattern: str, s: str) -> bool:
    words = s.split(' ')
    if len(pattern) != len(words):
        return False
    pattern_map = {}
    word_map = {}
    for char, word in zip(pattern, words):
        if char not in pattern_map:
            if word in word_map:
                return False
            pattern_map[char] = word
            word_map[word] = char
        else:
            if pattern_map[char] != word or word_map[word] != char:
                return False
    return True

