def findLevel(root, key, level):
    if root is None:
        return 0
    if root.data == key:
        return level
    downlevel = findLevel(root.left, key, level+1)
    if downlevel != 0:
        return downlevel
    downlevel = findLevel(root.right, key, level+1)
    return downlevel

