class Graph:
    def BellmanFord(self, V: int, graph: List[Tuple[int, int, int]]) -> bool:

        dist = [float("Inf")] * V 
        dist[0] = 0
        for _ in range(V - 1):
            for u, v, w in graph:
                if dist[u] != float("Inf") and dist[u] + w < dist[v]:
                    dist[v] = dist[u] + w
        for u, v, w in graph:
            if dist[u] != float("Inf") and dist[u] + w < dist[v]:
                return True
        return False

def checkSubarrayDivisibility(arr: List[int], K: int) -> bool:
    prefixSum = 0
    remainders = {0: -1}
    for i in range(len(arr)):
        prefixSum += arr[i]
        remainder = prefixSum % K
        if remainder in remainders:
            if i - remainders[remainder] > 1:
                return True
        else:
            remainders[remainder] = i
    return False

def cycleDetectionPrev(measurements: List[int]) -> int:
    product = 1
    prev = -1
    seen = {1}
    for measurement in measurements:
        product *= measurement
        if product in seen:
            return prev
        seen.add(product)
        prev = measurement
    return -1

def countDiagonalOnes(grid, k):
	# Function to count the number of non-overlapping subsequences
	# that form a diagonal of 1's in the grid
	memo = {}

	def checkDiagonal(row, col, string, k):
		if k == 0:
			return not any(string)
		if row == len(grid) or col == len(grid[0]):
			return False
		if (row, col, k) in memo:
			return memo[(row, col, k)]
		if grid[row][col] == '1':
			return checkDiagonal(row + 1, col + 1, string, k - 1)
		else:
			return checkDiagonal(row + 1, col, string + [False], k) or checkDiagonal(row, col + 1, string, k)

	count = 0
	for i in range(len(grid)):
		for j in range(len(grid[0])):
			count += checkDiagonal(i, j, [], k)

	return count

from random import randint

def matrixMult(A, B, C):
    n = len(A)
    x = [randint(0, 1) for _ in range(n)]
    Ax = [0]*n
    for i in range(n):
        for j in range(n):
            Ax[i] += A[i][j]*x[j]

    Bx = [0]*n
    for i in range(n):
        for j in range(n):
            Bx[i] += B[i][j]*x[j]

    Cx = [0]*n
    for i in range(n):
        for j in range(n):
            Cx[i] += C[i][j]*x[j]

    Ax_Bx = [Ax[i]-Bx[i] for i in range(n)]
    if Cx == Ax_Bx:
        return True
    else:
        return False

