def canBeDivided(arr: List[int]) -> bool:
    n = len(arr)
    prefix_sum = [0] * n
    prefix_sum[0] = arr[0]
    for i in range(1, n):
        prefix_sum[i] = prefix_sum[i-1] + arr[i]
    suffix_sum = [0] * n
    suffix_sum[n-1] = arr[n-1]
    for i in range(n-2, -1, -1):
        suffix_sum[i] = suffix_sum[i+1] + arr[i]
    for i in range(1, n-1):
        if prefix_sum[i-1] == suffix_sum[i+1]:
