def checkIfMatrixCanBeSorted(matrix: List[List[int]], rule: List[int]) -> bool:
    n, m = len(matrix), len(matrix[0])
    row_map = {}
    for i in range(n):
        row_sum = sum(matrix[i])
        row_map[row_sum] = row_map.get(row_sum, 0) + 1

    for r in rule:
        sum_count = 0
        for key in row_map:
            if key < r:
                sum_count += row_map[key]
        if sum_count == 0:
            return False
        row_map[r] -= 1
        if row_map[r] == 0:
            del row_map[r]

    return True

