def largestPowerOfTwoDivision(nums: List[int]) -> bool:
    largest_power = float('inf')
    for num in nums:
        power = 0
        while num % 2 == 0:
            num /= 2
            power += 1
        if power < largest_power:
            largest_power = power
    return largest_power

