def checkVisibility(N: int) -> bool:
    def digit_cubed_sum(number): 
    	sum_of_cubes = 0
    	while (number > 0):
    		d = number % 10
    		sum_of_cubes += d*d*d
    		number //= 10
    	return sum_of_cubes

    sequence = [N]
    while True:
        next_number = digit_cubed_sum(sequence[-1])
        if next_number in sequence:
            break
        sequence.append(next_number)

    if sequence[-1] == N and sequence[-1] != sequence[-2]:
        return True
    else:
        return False

