def isCircularPrime(num: int) -> bool:
	# Count digits
	digits = len(str(num))

	# Check for each rotation
	n = num
	while (isPrime(n)):
		# Rotate the number
		rem = n % 10
		div = n // 10
		n = (pow(10, digits - 1) * rem) + div
		# If all rotations are checked
		if (n == num):
			return True
		# If any rotation is not prime
		if not isPrime(n):
			return False
	return False

