    for j, num in enumerate(nums):
        if maxHeap and maxHeap[0][0] - num > limit:
            i = max([i, maxHeap[0][1]])
            while maxHeap and num >= maxHeap[-1][0]:
                maxHeap.pop()
            maxHeap.append((num, j))
        else:
