from typing import List

class TreeNode:
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None

def formBinaryTree(grid: List[List[int]]) -> bool:
    stack = []
    for val in grid:
        node = TreeNode(val)
        while stack and stack[-1].val < val:
            node.left = stack.pop()
        if stack:
            stack[-1].right = node
        stack.append(node)
    return len(stack) == 1

