def ratInAMaze(N, m):
    def isPath(x, y, N, m, sol):
        if x == N - 1 and y == N - 1 and m[x][y] == 1:
            sol[x][y] = 1
            return True

        if isSafe(x, y, N, m)==True:
            if sol[x][y]==1:
                return False

            # Move right
            sol[x][y] = 1
            if isPath(x+1,y,N,m, sol)==True:
                return True

            # Move down
            if isPath(x,y+1,N,m, sol)==True:
                return True

            # Move left
            if isPath(x-1,y,N,m, sol)==True:
                return True

            # Move up
            if isPath(x,y-1,N,m, sol)==True:
                return True
            sol[x][y]=0
            return False
        return False

    sol=[[0 for i in range(N)] for j in range(N)]
    if isPath(0,0,N,m,sol)==True:
        return True
    return False

