def find4Numbers(A: List[int], n: int, X: int) -> List[int]:
	zero = []
	A.sort()
	for i in range(n - 3):
		for j in range(i + 1, n - 2):
			l = j + 1
			r = n - 1
			while (l < r):
				if (A[i] + A[j] + A[l] + A[r] == X):
					zero.append([A[i], A[j], A[l], A[r]])
					l += 1
					r -= 1
				elif (A[i] + A[j] + A[l] + A[r] < X):
					l += 1
				else:
					r -= 1
	return zero

