        row_count = [0] * 10
        col_count = [0] * 10
        for j in range(9):
            if board[i][j] != 0:
                if row_count[board[i][j]] == 1:
                    return False
                row_count[board[i][j]] += 1
            if board[j][i] != 0:
                if col_count[board[j][i]] == 1:
                    return False
                col_count[board[j][i]] += 1
    # Check sub-grids
    for row in range(0, 9, 3):
        for col in range(0, 9, 3):
            subgrid_count = [0] * 10
            for i in range(row, row + 3):
