def is_valid_expression(s: str) -> bool:
    stack = []
    negation = False

    for char in s:
        if char == '!':
            negation = not negation
        elif char in '({[':
            if negation:
                stack.append(-ord(char))
            else:
                stack.append(ord(char))
            negation = False
        elif char in ')}]':
            if not stack:
                return False
            if negation:
                if stack[-1] + ord(char) != 0:
                    return False
                stack.pop()
            else:
                if stack[-1] == -ord(char):
                    stack.pop()
                else:
                    return False
            negation = False

    return len(stack) == 0

