def isTournamentConnected(matches: List[Tuple[int, int]]) -> bool:
    teams = set()
    for match in matches:
        teams.add(match[0])
        teams.add(match[1])

    graph = {team: set() for team in teams}

    for match in matches:
        graph[match[0]].add(match[1])
        graph[match[1]].add(match[0])

    visited = set()

    def dfs(node):
        if node not in visited:
            visited.add(node)
            for neighbor in graph[node]:
                dfs(neighbor)

    dfs(matches[0][0])

    return len(visited) == len(teams)

def followsPattern(pattern: str, testStr: str) -> bool:
    testList = testStr.split(" ")
    if len(pattern) != len(testList):
        return False
    pattern_map = {}
    for i in range(len(pattern)):
        if pattern[i] not in pattern_map:
            if testList[i] in pattern_map.values():
                return False
            pattern_map[pattern[i]] = testList[i]
        else:
            if pattern_map[pattern[i]] != testList[i]:
                return False
    return True

