def checkPermutation(str: str, k: int) -> bool:
	n = len(str)
	if (n < k):
		return False
	count = dict()
	for i in range(k):
		if (str[i] in count):
			count[str[i]] += 1
		else:
			count[str[i]] = 1
	for i in range(n - k + 1):
		if (i != 0):
			count[str[i - 1]] -= 1
			count[str[i + k - 1]] += 1
		mismatch = 0
		for j in count.values():
			if (j != 0):
				mismatch += 1
		if (mismatch == 0):
			return True

	return False

