def canConvert(str1: str, str2: str) -> bool:
    m, n = len(str1), len(str2)
    if abs(m - n) > 1:
        return False
    i, j, count = 0, 0, 0

    while i < m and j < n:
        if str1[i] != str2[j]:
            count += 1
            if count > 1:
                return False
            if m > n:
                i += 1
            elif m < n:
                j += 1
            else:
                i += 1
                j += 1
        else:
            i += 1
            j += 1
    if i < m or j < n:
        count += 1
    return count == 1

