def isNaturalNumbersSubarray(arr: List[int]) -> List[bool]:
    result = []
    n = len(arr)
    for i in range(n):
        temp = [False] * n
        hash_map = [0] * (n + 1)
        temp[i] = True
        hash_map[arr[i]] = 1
        for j in range(i + 1, n, 1):
            if (j - i + 1 > n):
                break
            temp[j] = True
            hash_map[arr[j]] = 1
            flag = 0
            for k in range(i, j + 1, 1):
                if (hash_map[k + 1] != 1):
                    flag = 1
                    break
            if (flag == 0):
                result.append(True)
            else:
                result.append(False)
    return result

