def isSortable(arr: List[int], n: int, k: int) -> bool:
    pos = [0] * (n + 1)
    for i in range(n):
        pos[arr[i]] = i
    for i in range(n):
        if (arr[i] != i + 1):
            x = pos[i + 1]
            if (x + 1) % k != 0:
                return False
            arr[i], arr[x] = arr[x], arr[i]
            pos[arr[x]] = x
            pos[arr[i]] = i
    return True

def hasDistinctUglyNumbers(arr):
    ugly_set = set()
    for num in arr:
        if num <= 0:
            continue
        while num % 2 == 0:
            num //= 2
        while num % 3 == 0:
            num //= 3
        while num % 5 == 0:
            num //= 5
        if num == 1:
            return True
        if num in ugly_set:
            continue
        ugly_set.add(num)
    return False

from typing import List
def splitSumEqualGroups(nums: List[int]) -> bool:
    total_sum = sum(nums)
    if total_sum % 2 != 0:
        return False
    target_sum = total_sum // 2

    def canSplit(nums, index, curr_sum, target_sum):
        if curr_sum == target_sum:
            return True
        if index == len(nums) or curr_sum > target_sum:
            return False
        return canSplit(nums, index + 1, curr_sum + nums[index], target_sum) or canSplit(nums, index + 1, curr_sum, target_sum)

    return canSplit(nums, 0, 0, target_sum)

def makeEqual(a: int, b: int, c: int) -> bool:
    total_sum = a + b + c
    max_val = max(a, b, c)

    if total_sum % 3 == 0 and max_val <= total_sum // 3:
        return True
    return False

