        if r <= 0 or (l <= k and i == n - 1):
            return True
    return False

def isOddLengthSubarraySumPossible(arr):
    prefixSum = [0]
    for num in arr:
        prefixSum.append(prefixSum[-1] + num)
    totalSum = prefixSum[-1]
    if totalSum % 2 != 0:
        return False
    targetSum = totalSum // 2
    possibleSums = set()
    for i in range(len(arr)):
        for j in range(i+1, len(arr)):
            possibleSums.add(prefixSum[j+1] - prefixSum[i])
    return targetSum in possibleSums

