def areRootsReciprocal(a: int, b: int, c: int) -> bool:
	d = b * b - 4 * a * c
	if(d < 0):  
		return False
	else:
		root1 = (-b + math.sqrt(d))/(2*a)
		root2 = (-b - math.sqrt(d))/(2*a)
		if(root1*root2 == 1):
			return True
		else:
			return False

