def canReachFinalIndex(arr):
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def isPerfectSquare(x):
        s = int(x ** 0.5)
        return s * s == x

    def canReachUtil(arr, x, y):
        if y == 0:
            return x >= len(arr) - 1

        n = len(arr)
        if n == 0:
            return True

        if n < y:
            return False

        g = gcd(x, y)
        return canReachUtil(arr, y, x % y) if g == 1 else isPerfectSquare(g * g + 4 * n)

    return canReachUtil(arr, 0, 1)

