def productSign(a: int, b: int) -> str :
    if a > b:
        return "Invalid input"
    elif a == b:
        if a == 0:
            return "zero"
        else:
            return "positive"
    else:
        signs = 1
        for i in range(a, b+1):
            signs *= i
        if signs > 0:
            return "positive"
        elif signs < 0:
            return "negative"
        else:
            return "zero"

