def isTriangleWithCircumference(A: (int, int), B: (int, int), C: (int, int)) -> bool:
    def distance(p1, p2):
        return (p1[0]-p2[0])**2 + (p1[1]-p2[1])**2
    AB = distance(A, B)
    BC = distance(B, C)
    CA = distance(C, A)
    if AB + BC > CA and BC + CA > AB and CA + AB > BC:
        return True
    return False

