        product = 1
        for j in range(i, n):
            product *= arr[j]
            if product == 0:
                break
            if product == 1:
                continue
            root = product ** (1 / (j - i + 1))
            if all(round(arr[k] ** (1 / (k - i + 1)), 6) == round(root, 6) for k in range(i, j + 1)):
                return True
