def isZigzagPattern(s: str, n: int) -> bool:
    if n == 1:
        return True
    rows = ['' for _ in range(min(n, len(s)))]
    index = 0
    step = 1
    for char in s:
        rows[index] += char
        if index == 0:
            step = 1
        elif index == n - 1:
            step = -1
        index += step
    return ''.join(rows) == s

