def findFirst(arr: List[int], low: int, high: int, x: int, n: int) -> int:
    if (high >= low):
        mid = (low + high)//2
        if ((mid == 0 or x > arr[mid-1]) and (arr[mid] == x)):
            return mid
        elif (x > arr[mid]):
            return findFirst(arr, (mid + 1), high, x, n)
        else:
            return findFirst(arr, low, (mid - 1), x, n)
    return -1

