def findMatrix(rowSum: List[int], colSum: List[int]) -> List[List[int]] :
    m = len(rowSum)
    n = len(colSum)

    if m * n != sum(rowSum):
        return []

    res = [[0] * n for _ in range(m)]

    for i in range(m):
        for j in range(n):
            res[i][j] = min(rowSum[i], colSum[j])
            rowSum[i] -= res[i][j]
            colSum[j] -= res[i][j]

    return res

