def countIncreasing(A: List[int], l: int, r: int) -> int:

    cnt = 0
    length = 1
    for i in range(l, r):
        if A[i + 1] > A[i]:
            length += 1
        else:
            cnt += ((length - 1) * length) // 2
            length = 1
    if length > 1:
        cnt += ((length - 1) * length) // 2
    return cnt

