    for i in range(1, rows+1):
        for j in range(1, cols+1):
            prefix_sum[i][j] = grid[i-1][j-1] + prefix_sum[i-1][j] + prefix_sum[i][j-1] - prefix_sum[i-1][j-1]

    for r1 in range(1, rows+1):
        for c1 in range(1, cols+1):
            for r2 in range(r1, rows+1):
