def PredictTheWinner(nums: List[int]) -> bool:
    def helper(nums, s, e, memo):
        if s == e:
            return nums[s]
        if (s, e) in memo:
            return memo[(s, e)]
        memo[(s, e)] = max(nums[s] - helper(nums, s+1, e, memo), nums[e] - helper(nums, s, e-1, memo))
        return memo[(s, e)]

    return helper(nums, 0, len(nums)-1, {}) >= 0

def properBrackets(s: str) -> bool:
    stack = []
    for char in s:
        if char == '(' or char == '{' or char == '[':
            stack.append(char)
        else:
            if not stack:
                return False
            elif (char == ')' and stack[-1] != '(') or (char == '}' and stack[-1] != '{') or (char == ']' and stack[-1] != '['):
                return False
            else:
                stack.pop()
    return not stack

