def isOddStandardDeviation(numbers: List[int]) -> bool:
    productSet = set()
    for i in range(1, len(numbers)):
        for subset in combinations(numbers, i):
            product = 1
            for num in subset:
                product *= num
            productSet.add(product)
    std_dev = stdev(productSet)
    return std_dev % 2 != 0

