    return False

def isFibonacciBinary(s: str) -> bool:
    def backtrack(start, seq):
        if start == len(s) and len(seq) >= 3:
            return True
        for end in range(start + 1, len(s) + 1):
            substr = s[start:end]
            if (len(substr) > 1 and substr[0] == '0') or (substr[0] == '1' and len(substr) > 32):
                break
            num = int(substr, 2)
            if num > 2**31 - 1:
                break
            size = len(seq)
            if size >= 2 and num != seq[size - 1] + seq[size - 2]:
                continue
            if backtrack(end, seq + [num]):
                return True
        return False
    return backtrack(0, [])

