def splitIntoFibonacci(S: str) -> List[int]:
    def backtrack(index, path):
        if index == len(S) and len(path) > 2:
            return path
        for i in range(index, len(S)):
            if S[index] == "0" and i > index:
                break
            num = int(S[index:i + 1])
            if num > 2**31 - 1:
                break
            if len(path) < 2 or num == path[-1] + path[-2]:
                if backtrack(i + 1, path + [num]):
                    return path + [num]
        return []

    return backtrack(0, [])

