	while (x > 0 and y > 0):
		if x == y:
			return True
		# If X is greater, then reduce X
		if x > y:
			if x <= 2:
				return False
			#Update x with the value of x-3^i 
			x = x - 3;
		#If Y is greater, then reduce Y 
		else:
			if y <= 2:
				return False
