def findQuadruplet(nums: List[int], target: int) -> List[int]:
    nums.sort()
    n = len(nums)

    for i in range(n - 3):
        for j in range(i + 1, n - 2):
            left = j + 1
            right = n - 1
            while left < right:
                current_sum = nums[i] + nums[j] + nums[left] + nums[right]
                if current_sum == target:
                    return [nums[i], nums[j], nums[left], nums[right]]
                elif current_sum < target:
                    left += 1
                else:
                    right -= 1

    return []

def canMakeEqualWithKReplacements(str1: str, str2: str, k: int) -> bool:
    n = len(str1)
    if n != len(str2):
        return False
    freq1 = [0]*26
    freq2 = [0]*26

    for i in range(n):
        freq1[ord(str1[i]) - ord('a')] += 1
        freq2[ord(str2[i]) - ord('a')] += 1
    corrections = 0
    for i in range(26):
        corrections += abs(freq1[i] - freq2[i])
    return corrections <= k

def patternMatching(pattern: str, s: str) -> bool:
    n = len(s)
    cnt_a = sum(1 for c in pattern if c == 'a')
    cnt_b = len(pattern) - cnt_a
    if cnt_a == 0 and cnt_b == 0:
        return n == 0
    if cnt_a == 0 or cnt_b == 0:
        if n % max(cnt_a, cnt_b) != 0:
            return False
        length = n // max(cnt_a, cnt_b)
        return s == s[:length] * max(cnt_a, cnt_b)
    for len_a in range(n // cnt_a + 1):
        rest = n - cnt_a * len_a
        if (cnt_b == 0 and rest == 0) or (cnt_b != 0 and rest % cnt_b == 0):
            len_b = 0 if cnt_b == 0 else rest // cnt_b
            pos, valid = 0, True
            a, b = None, None
            for ch in pattern:
                if ch == 'a':
                    sub = s[pos:pos + len_a]
                    if a is None:
                        a = sub
                    elif a != sub:
                        valid = False
                        break
                    pos += len_a
                else:
                    sub = s[pos:pos + len_b]
                    if b is None:
                        b = sub
                    elif b != sub:
                        valid = False
                        break
                    pos += len_b
            if valid and a != b:
                return True
    return False

