def isPossibleToSort(arr: list, k: int) -> bool:
    n = len(arr)
    index = {}
    for i in range(n):
        index[arr[i]] = i
    count = 0
    for i in range(n):
        if count > k:
            return False
        if arr[i] != n - i:
            ind = index[n - i]
            index[arr[i]] = ind
            index[n - i] = i
            arr[i], arr[ind] = arr[ind], arr[i]
            count += 1
    return True

