def patternMatching(pattern: str, s: str) -> bool:
    if not pattern:
        return not s
    count_a = pattern.count('a')
    count_b = len(pattern) - count_a
    if count_a == 0:
        if len(s) % count_b != 0:
            return False
        len_b = len(s) // count_b
        if s == s[:len_b] * count_b:
            return True
        else:
            return False
    if count_b == 0:
        if len(s) % count_a != 0:
            return False
        len_a = len(s) // count_a
        if s == s[:len_a] * count_a:
            return True
        else:
            return False
    for len_a in range(len(s) // count_a + 1):
        len_b = (len(s) - len_a * count_a) // count_b
        if len_a * count_a + len_b * count_b != len(s):
            continue
        pos = 0
        valid = True
        a_word, b_word = None, None
        for ch in pattern:
            if ch == 'a':
                sub_s = s[pos:pos + len_a]
                if a_word is None:
                    a_word = sub_s
                elif a_word != sub_s:
                    valid = False
                    break
                pos += len_a
            else:
                sub_s = s[pos:pos + len_b]
                if b_word is None:
                    b_word = sub_s
                elif b_word != sub_s:
                    valid = False
                    break
                pos += len_b
        if valid and a_word != b_word:
            return True
    return False

