def isDivisibleByPrime(n: int, r: int, p: int) -> bool:
    def nCr(n, r):
        return (fact(n) // (fact(r) * fact(n - r)))

    def fact(n):
        res = 1
        for i in range(2, n + 1):
            res = (res * i) % p
        return res

    if n < r:
        return False
    if r == 0 or n == r:
        return True
    return (nCr(n, r) % p == 0)

