def isValidSplit(arr: List[int], K: int) -> bool:

    left, right = 0, len(arr) - 1
    left_sum, right_sum = 0, 0

    while left <= right:
        if abs(left_sum - right_sum) <= K:
            return True
        if left_sum < right_sum:
            left_sum += arr[left]
            left += 1
        else:
            right_sum += arr[right]
            right -= 1

    return abs(left_sum - right_sum) <= K

