def middleElementsFormUnsetInt(arr: List[int]) -> bool:
	n = len(arr)
	if n % 2 == 0:
		return False
	middle_index = n // 2
	num = 0
	for i in range(middle_index-1, middle_index+2):
		if i < 0 or i >= n:
			return False
		num = (num << 1) | arr[i]
	left = middle_index - 1
	right = n - middle_index - 1
	if num < (1 << left) or num > ((1 << right) - 1):
