    		sum_of_cubes += d*d*d
    		number //= 10
    	return sum_of_cubes

    slow = N
    fast = N
    while (True):
    	slow = digit_cubed_sum(slow)
    	fast = digit_cubed_sum(digit_cubed_sum(fast))
