        if len(graph[node]) == 1 and node != 0:
            return path
        for neighbor in graph[node]:
            if neighbor not in path:
                return dfs(neighbor, path + [neighbor])

    for node in graph:
        if len(graph[node]) > 1:
            path = dfs(node, [node])
            if len(path) > 2:
                values = [graph[n] for n in path]
                if any(all(v) for v in zip(*values)):
                    return True
    return False

