class DoublyCircularLinkedList:
	def __init__(self):
		self.head = None

	def insert(self, data):
		new_node = Node(data)
		if self.head is None:
			self.head = new_node
			self.head.next = self.head
			self.head.prev = self.head
			return
		last = self.head.prev
		last.next = new_node
		new_node.prev = last
		new_node.next = self.head
		self.head.prev = new_node

	def search(self, key):
		if self.head is None:
			return False
		temp = self.head
		while True:
			if temp.data == key:
				return True
			temp = temp.next
			if temp == self.head:
				break
		return False

