            return False
        if maze[x][y] == 'E':
            return True
        temp = maze[x][y]
        maze[x][y] = 'X'
        if dfs(x + 1, y) or dfs(x - 1, y) or dfs(x, y + 1) or dfs(x, y - 1):
            return True
        maze[x][y] = temp
