def isOddCycle(n: int, edges: List[Tuple[int, int, int]], k: int) -> bool:
    adj = [[] for _ in range(n)]
    for u, v, w in edges:
        adj[u-1].append((v-1, w))
        adj[v-1].append((u-1, w))

    color = [-1]*n

    def dfs(v, c):
        color[v] = c
        for u, w in adj[v]:
            if color[u] == -1:
                if dfs(u, c^w) == False:
                    return False
            elif color[u]^w != color[v]:
                if (color[u]^c^w)%2 == 1:
                    return False
        return True

    for i in range(n):
        if color[i] == -1:
            if not dfs(i, 0):
                return True
    return False

