            if checkSubmatrix(matrix):
                return True
            matrix[i], matrix[j] = matrix[j], matrix[i]

    for i in range(m):
        for j in range(i + 1, m):
            col = [matrix[x][i] for x in range(n)]
            new_col = [1 - x for x in col]
            for x in range(n):
                matrix[x][i] = new_col[x]
            if checkSubmatrix(matrix):
                return True
            for x in range(n):
                matrix[x][i] = col[x]

    return False

