def isBipartite(n: int, edges: List[List[int]]) -> bool:
        graph = [[] for _ in range(n)]
        for u, v in edges:
            graph[u].append(v)
            graph[v].append(u)

        colors = [0] * n

        def dfs(node, color):
            if colors[node] != 0:
                return colors[node] == color
            colors[node] = color
            for neighbor in graph[node]:
                if not dfs(neighbor, -color):
                    return False
            return True

        for i in range(n):
            if colors[i] == 0 and not dfs(i, 1):
                return False
        return True

