    queue = [(start_index, -1)]
    visited = [False] * len(adjacency_matrix)

    while queue:
        node, parent = queue.pop(0)
        visited[node] = True
        for neighbor, _ in filter(lambda x: x[1], enumerate(adjacency_matrix[node])):
            if neighbor == parent:
                continue
            if visited[neighbor]:
                return True
            queue.append((neighbor, node))
    return False

