def canPartitionArray(arr: List[int], K: int, limitL: int, limitR: int) -> bool:

	n = len(arr)
	prefix = [0] * (n + 1)
	for i in range(1, n + 1):
		prefix[i] = prefix[i - 1] + arr[i - 1]
	cnt = 0
	for i in range(1, n + 1):
		for j in range(i, n + 1):
			sum_ = prefix[j] - prefix[i - 1]
			if (sum_ >= limitL and sum_ <= limitR):
				cnt += 1
				break
	return cnt >= K

