from collections import deque

def hasOddLengthPath(N: int, tree: List[List[int]], queries: List[Tuple[int, int]]) -> List[bool]:
    def bfs(x: int) -> List[int]:
        visited = [False] * (N + 1)
        distance = [0] * (N + 1)

        q = deque()
        q.append(x)
        visited[x] = True

        while q:
            s = q.popleft()

            for i in tree[s]:
                if not visited[i]:
                    q.append(i)
                    distance[i] = distance[s] + 1
                    visited[i] = True

        return distance

    distances = bfs(1)

    result = []
    for query in queries:
        x, y = query
        if (distances[x] + distances[y]) % 2 != 0:
            result.append(True)
        else:
            result.append(False)

    return result

