def isDivisibleSumOfLeaves(root: TreeNode, k: int) -> bool:
	def isLeaf(node):
		return node and not node.left and not node.right

	if not root:
		return False

	queue = [root]
	sumLeaves = 0

	while queue:
		node = queue.pop(0)
		if isLeaf(node):
			sumLeaves += int(node.value, 2)
		if node.left:
			queue.append(node.left)
		if node.right:
			queue.append(node.right)

	return sumLeaves % k == 0

