from collections import defaultdict, deque

def validateGraph(degrees: List[int]) -> bool:
    if sum(degrees) % 2 != 0:
        return False  # Sum of degrees must be even for a valid graph
    graph = defaultdict(list)
    for i, degree in enumerate(degrees):
        graph[i]  = [None] * degree
    visited = [False] * len(degrees)
    queue = deque([0])
    while queue:
        node = queue.popleft()
        if visited[node]:
            continue
        visited[node] = True
        for neighbor in graph[node]:
            if not visited[neighbor]:
                queue.append(neighbor)
    return all(visited)

