	prime_factors = set()
	while N % 2 == 0:
		prime_factors.add(2)
		N = N // 2
	for i in range(3, int(N**0.5) + 1, 2):
		while N % i == 0:
			prime_factors.add(i)
			N = N // i
	if N > 2:
		prime_factors.add(N)
	return len(prime_factors) == len(set(prime_factors))

