def isPathCrossing(moves: str) -> bool:
    x, y = 0, 0
    visited = {(0, 0)}
    for move in moves:
        if move == 'U':
            y += 1
        elif move == 'D':
            y -= 1
        elif move == 'L':
            x -= 1
        elif move == 'R':
            x += 1
        if (x, y) in visited:
            return True
        visited.add((x, y))
    return False

