def canBeEqualBySwappingArrays(A: List[int], B: List[int]) -> bool:
    if len(set(A)) != len(set(B)):
        return False
    for num in set(A):
        if A.count(num) != B.count(num):
            return False
    return True

def findTriplet(arr: list, sum: int) -> bool:
    arr.sort()
    n = len(arr)
    for i in range(n-2):
        l, r = i + 1, n - 1
        while l < r:
            current_sum = arr[i] + arr[l] + arr[r]
            if current_sum == sum:
                return True
            elif current_sum < sum:
                l += 1
            else:
                r -= 1
    return False

