def isConvertable(s: str, t: str) -> bool:
    if sorted(s) != sorted(t):
        return False
    n = len(s)
    i = 0
    while i < n-1:
        if s[i] != t[i]:
            j = i
            while j < n-1 and s[j] != t[i]:
                j += 1
            s = s[:i] + ''.join(sorted(s[i:j+1])) + s[j+1:]
        i += 1
    return s == t

