    for i in range(1, N+1):
        if N%i==0:
            digits = [int(d) for d in str(i)]
            is_aesthetic = all(abs(digits[j] - digits[j+1]) in range(1, len(digits)) for j in range(len(digits)-1))
            result[i] = is_aesthetic
