def isContinuousSlope(buildingHeights: list) -> bool:
    n = len(buildingHeights)
    clockwise = True
    anticlockwise = True
    for i in range(n-1):
        diff = buildingHeights[i+1] - buildingHeights[i]
        if i == 0:
            prev_diff = diff
        else:
            if diff * prev_diff <= 0:
                clockwise = False
                break
            prev_diff = diff
    for i in range(n-1):
        diff = buildingHeights[i+1] - buildingHeights[i]
        if i == 0:
            prev_diff = diff
        else:
            if diff * prev_diff >= 0:
                anticlockwise = False
                break
            prev_diff = diff
    return clockwise or anticlockwise

