def isBalancedSequence(sequence: list) -> bool:
    total_sum = sum(sequence)
    if total_sum % 2 != 0:
        return False
    left_sum = 0
    for num in sequence:
        if left_sum == total_sum - left_sum:
            return True
        left_sum += num
    return False

