def oddEvenDivisors(n: int) -> bool:
	countOdd = 0
	countEven = 0
	for i in range(1, int(n ** 0.5) + 1):
		if n % i == 0:
			if i % 2 != 0:
				countOdd += 1
			if (n // i) % 2 != 0:
				countOdd += 1
			if i % 2 == 0:
				countEven += 1
			if (n // i) % 2 == 0:
				countEven += 1
	# check if odd count of odd divisors and even count of even divisors or not
	if countOdd % 2 == 1 and countEven % 2 == 0:
		return True
	return False

