def isValidSplit(s: str, start: int, end: int) -> bool:
    sub_s = s[start:end+1]
    char_count = {}

    for char in sub_s:
        if char in char_count:
            char_count[char] += 1
        else:
            char_count[char] = 1

    dominant_count = max(char_count.values())
    if dominant_count > (end - start + 1) / 2:
        return True
    else:
        return False

