def doesDirectionExist(ranges: List[Tuple[int, int]]) -> bool:
    n = len(ranges)
    points = []
    for i in range(n):
        points.append((ranges[i][0], 'L', i))
        points.append((ranges[i][1], 'R', i))
    points.sort()
    maxRightEnd = -1
    for point in points:
        if point[1] == 'L':
            if maxRightEnd != -1:
                return False
            else:
                maxRightEnd = ranges[point[2]][1]
        else:
            if ranges[point[2]][1] == maxRightEnd:
                maxRightEnd = -1
    return True

