def sumInteriorAnglesOfCuboids(cuboids):
    total_angle = 0
    for cuboid in cuboids:
        l, w, h = cuboid
        interior_angle = 2 * (l * w + w * h + h * l)
        total_angle += interior_angle
    return total_angle

