def hasDuplicateParenthesis(expression: str) -> bool:
    stack = []
    for char in expression:
        if char == ')':
            top = stack.pop()
            if top == '(':
                return True
            else:
                count = 0
                while top != '(':
                    count += 1
                    top = stack.pop()
                if count < 1:
                    return True
        else:
            stack.append(char)
    return False

