def canReachTarget(start: int, target: int, jumps: List[int]) -> bool:
    if start == target:
        return True
    if start > target:
        return False
    if len(jumps) == 0:
        return False
    for jump in jumps:
        if canReachTarget(start + jump, target, jumps) or canReachTarget(start - jump, target, jumps):
            return True
    return False

