def isPossibleToObtainX(stack, X):
    product = 1
    for num in stack:
        product *= num
    if product % X != 0:
        return False
    gcd_val = stack[0]
    for num in stack[1:]:
        gcd_val = gcd(gcd_val, num)
    if gcd_val == 0:
        return X == 0
    lcm_val = stack[0]
    for num in stack[1:]:
        lcm_val = lcm_val*num//gcd(lcm_val, num)
    return lcm_val%X == 0

