def constructBinaryTree(arr, root, i, n):
    if i < n:
        temp = TreeNode(arr[i])
        root = temp
        root.left = constructBinaryTree(arr, root.left, 2 * i + 1, n)
        root.right = constructBinaryTree(arr, root.right, 2 * i + 2, n)
    return root

def isAcyclic(root):
    visited = set()

    def dfs(node):
        if node is None:
            return False
        if node in visited:
            return True
        visited.add(node)
        return dfs(node.left) or dfs(node.right)

    return dfs(root) == False

def isHeightValid(root):
    def height(node):
        if node is None:
            return 0
        return 1 + max(height(node.left), height(node.right))

    leaf_nodes = (height(root) + 1) // 2
    internal_nodes = (leaf_nodes - 1) // 2
    return math.isclose(2 * (leaf_nodes + internal_nodes), height(root))

def isTreeValid(arr, n):
    root = constructBinaryTree(arr, None, 0, n)
    if isAcyclic(root) and isHeightValid(root):
        return True
    return False

def checkSubstr(s: str, k: int) -> bool:
	n = len(s)
	count_zero = 0
	count_one = 0
	for i in range(k):
		if (s[i] == '0'):
			count_zero += 1
		else:
			count_one += 1
	if (count_zero != count_one):
		return False
	for i in range(k, n):
		if (s[i - k] == '0'):
			count_zero -= 1
		else:
			count_one -= 1
		if (s[i] == '0'):
			count_zero += 1
		else:
			count_one += 1
		if (count_zero != count_one):
			return False
	return True

def is_moran_number(N: int) -> bool:
    def is_fibonacci(num):
        a, b = 0, 1
        while b < num:
            a, b = b, a + b
        return b == num

    i = 1
    while True:
        moran_number = is_fibonacci(2*i-1) * is_fibonacci(2*i+1)
        if moran_number == N:
            return True
        if moran_number > N:
            return False 
        i += 1

def validatePostorderTraversal(postorder: str, delimiter: str) -> bool:
  vertices = postorder.split(delimiter)
  stack = []
  root = float('inf')

  for vertex in reversed(vertices):
    if int(vertex) > root:
      return False
    while stack and int(vertex) < stack[-1]:
      root = stack.pop()
    stack.append(int(vertex))

  return True

