def isEditDistanceOne(s1: str, s2: str) -> bool:
    if abs(len(s1) - len(s2)) > 1:
        return False
    if len(s1) < len(s2):
        s1, s2 = s2, s1
    m, n = len(s1), len(s2)
    i, j, count = 0, 0, 0
    while i < m and j < n:
        if s1[i] != s2[j]:
            if count == 1:
                return False
            if m == n:
                j += 1
            i += 1
            count += 1
        else:
            i += 1
            j += 1
    if i < m:
        count += 1
    return count == 1 or (count == 0 and m > n)

def isPathSumDivisible(matrix: List[List[int]], i: int, j: int, K: int) -> bool:
    n = len(matrix)
    visited = [False] * n

    def dfs(curr, path_sum):
        if curr == j:
            return path_sum % K == 0
        visited[curr] = True
        for next_node in range(n):
            if matrix[curr][next_node] != 0 and not visited[next_node]:
                if dfs(next_node, path_sum + matrix[curr][next_node]):
                    return True
        visited[curr] = False
        return False

    return dfs(i, 0)

