        return False

    level_sum = {}

    def dfs(node, level, parent_val):
        if not node:
            return
        if level in level_sum:
            level_sum[level] += node.value
        else:
            level_sum[level] = node.value
        dfs(node.left, level + 1, node.value)
        dfs(node.right, level + 1, node.value)

    dfs(root, 0, 0)

    for val in level_sum.values():
        if isPerfectSquare(val):
            return True

    return False

