def findLoopMagnitude(head):
    slow = head
    fast = head
    loop = 0
    while fast and fast.next:
        slow = slow.next
        fast = fast.next.next
        if slow == fast:
            loop = 1
            break

    if loop:
        slow = head
        while slow != fast:
            slow = slow.next
            fast = fast.next
            loop += 1
        return loop
    else:
        return 0

