def randomSolution(a: int, b: int, c: int, d: int, e: int, f: int) -> (float, float, bool):
    determinant = a * e - b * d
    parallel = False

    if determinant == 0:
        parallel = True
        return (random.random(), random.random(), parallel)

    x = (c * e - b * f) / determinant
    y = (a * f - c * d) / determinant

    return (x, y, parallel)

