def isSortedAndRotated(arr: List[int]) -> bool:
    n = len(arr)
	if (n == 1):
		return True
	l = 0
	r = n - 1
	while (l < r):
		mid = l + (r - l) // 2
		if (arr[mid] > arr[r]):
			l = mid + 1
		else:
			r = mid
	rev_point = l
	if (rev_point == 0):
		return False
	l = 0
	r = n - 1
	while (l < r):
		mid = l + (r - l) // 2
		rotated_mid = (mid + rev_point) % n
		if (arr[rotated_mid] == arr[mid]):
			l = l + 1
		else:
			r = mid
	return (l + 1 == r)

